    render(){
        return(
            <div>
               <Welcome/>
            </div>
        )
    }
}
class Welcome extends React.Component(){
    render(){
        return(
            <div>
            <p style={{textAlign: 'center'}}>Welcome{name}</p>
        </div>
        )
    }
}
export default Master;
